import React from 'react';
import Post from './Post.js';
import image from '../image/dow.jpg';
import avatarka from '../image/down2.jpg';
import img from '../image/images.jpg';
import s from './Profile.module.css';

const Profile = () => {
  return (
    <div className={s.content}>
      <div className='image'>
        <img src={image} />
      </div>
      <div>
        <img src={img} />
      </div>
      <div>ava + description</div>
      <div>My posts</div>
      <Post />
      <div>New Post</div>
      <div className='posts'>
        <div className={s.item}>
          <img src={avatarka} />
          post 1
        </div>
        <div className={s.item}>
          <img src={avatarka} />
          post 2
        </div>
        <div className={s.item}>
          <img src={avatarka} />
          post 3
        </div>
        <div className={s.item}>
          <img src={avatarka} />
          post 4
        </div>
        <div className={s.item}>post 5</div>
        <div className={s.item}>post 6</div>
      </div>
    </div>
  );
};

export default Profile;
